import React, { Component } from "react";
 
class CourseList extends Component {
  render() {
    return (
      <div>
        <h2>Course List</h2>
        <li><NavLink to="/Faculty/DataScience"> Data Science</NavLink> </li>
        <li><NavLink to="/Faculty/MachineLearning">Machine Learning</NavLink> </li>
        <li><NavLink to="/Faculty/BigData">Big Data</NavLink> </li>
      </div>
    );
  }
}
export default CourseList;
